const apiKey = 'b69ce63df91b692b402e8436d1099819';
const TMDBURL = 'https://api.themoviedb.org/3/movie';

export async function movies(movieid) {
  return await fetch(`
        ${TMDBURL}/${movieid}/videos?api_key=${apiKey}&language=en
    `).then((res) => res.json());
}
